enum KvNamespace {
    Create {
            binding: String,
            preview: bool,
        },
    Delete {
            namespace: Namespace,
            force: bool,
        },
    List,
}

enum KvKey {
    Put {
            namespace: Namespace,
            key: String,
            value: String,
            expiration_ttl: Option<u64>,
            expiration: Option<u64>,
            metadata: Option<String>,
            path: bool,
        },
    Get {
            namespace: Namespace,
            key: String,
        },
    Delete {
            namespace: Namespace,
            key: String,
            force: bool,
        },
    List {
            namespace: Namespace,
            prefix: Option<String>,
        },
}

enum KvBulk {
    Put {
            namespace: Namespace,
            path: PathBuf,
        },
    Delete {
            namespace: Namespace,
            path: PathBuf,
            force: bool,
        },
}

enum Bucket {
    List,
    Create {
            name: String,
        },
    Delete {
            name: String,
        },
}

enum Route {
    List,
    Delete {
            route_id: String,
        },
}

enum Secret {
    Put {
            name: String,
        },
    Delete {
            name: String,
        },
    List,
}

enum Command {
    KvNamespace(kv::KvNamespace),
    KvKey(kv::KvKey),
    KvBulk(kv::KvBulk),
    R2(r2::R2),
    Route(route::Route),
    Secret(secret::Secret),
    Generate {
            name: String,
            template: Option<String>,
            target_type: Option<TargetType>,
            site: bool,
        },
    Init {
            name: Option<String>,
            target_type: Option<TargetType>,
            site: bool,
        },
    Build,
    Preview {
            method: HttpMethod,
            url: Url,
            body: Option<String>,
            watch: bool,
            headless: bool,
        },
    Dev {
            host: Option<String>,
            ip: Option<IpAddr>,
            port: Option<u16>,
            local_protocol: Option<Protocol>,
            upstream_protocol: Option<Protocol>,
            inspect: bool,
            unauthenticated: bool,
        },
    Publish {
            release: bool,
            output: Option<String>,
            migration: AdhocMigration,
        },
    Config {
            api_key: bool,
            no_verify: bool,
        },
    Subdomain {
            name: Option<String>,
        },
    Whoami,
    Tail {
            name: Option<String>,
            format: TailFormat,
            once: bool,
            sampling_rate: f64,
            status: Vec<String>,
            method: Vec<String>,
            header: Vec<String>,
            ip_address: Vec<String>,
            search: Option<String>,
            url: Option<Url>,
            tunnel_port: Option<u16>,
            metrics_port: Option<u16>,
        },
    Login {
            scopes: Vec<String>,
            scopes_list: bool,
        },
    Logout,
    Report {
            log: Option<PathBuf>,
        },
}

fn create<impl ApiClient>(&impl ApiClient, &str, &str)
-> Result<ApiSuccess<WorkersKvNamespace>, ApiFailure> where
impl ApiClient: ApiClient

enum Binding {
    WasmModule {
            name: String,
            part: String,
        },
    KvNamespace {
            name: String,
            namespace_id: String,
        },
    R2Bucket {
            name: String,
            bucket_name: String,
        },
    DurableObjectsClass {
            name: String,
            class_name: String,
            script_name: Option<String>,
        },
    TextBlob {
            name: String,
            part: String,
        },
    PlainText {
            name: String,
            text: String,
        },
}

enum GlobalUser {
    ApiTokenAuth {
            api_token: String,
        },
    OAuthTokenAuth {
            oauth_token: String,
            refresh_token: String,
            expiration_time: String,
        },
    GlobalKeyAuth {
            email: String,
            api_key: String,
        },
}

enum UploadFormat {
    ServiceWorker {
        },
    Modules {
            main: String,
            dir: PathBuf,
            rules: Option<Vec<ModuleRule>>,
        },
}

enum Migrations {
    Adhoc {
            script_tag: MigrationTag,
            provided_old_tag: Option<String>,
            new_tag: Option<String>,
            migration: Option<Migration>,
        },
    List {
            script_tag: MigrationTag,
            migrations: Vec<MigrationConfig>,
        },
}
